        "mantananiIsland":
            MessageLookupByLibrary.simpleMessage("Isla ng Mantanani"),
        "mantananiIslandContent": MessageLookupByLibrary.simpleMessage(
            "Malapit sa Kota Belud sa Sabah, ang isla ng Mantanani ay nag-aalok ng ilan sa pinakamahusay na mga lugar ng diving sa Borneo. Maraming snorkelers at divers ang pumupunta upang makipagsabayan sa mga kabayo-dagat at stingray sa mga day trip mula sa kabisera. Ang mga certified divers ay maaaring mag-dive sa higit sa 20 lokasyon, kasama na ang tatlong shipwrecks. Pagkatapos ng ilang oras sa Timog Dagat Tsina, magpahinga at mag-enjoy sa tanyag na paglubog ng araw sa Borneo sa dalampasigang puting buhangin."),
