        "mossyForest": MessageLookupByLibrary.simpleMessage(
            "Mossy Forest, Cameron Highlands"),
        "mossyForestContent": MessageLookupByLibrary.simpleMessage(
            "Ang Mossy Forest ay isang natural na ekosistema na tumutubo lamang sa mas mataas na altitud sa Cameron Highlands at iba pang kabundukan sa Malaysia. Ang mga ulap sa mababang antas na dala ng hangin ay bumabalot sa mga puno ng malamig at mahalumigmig na hamog, na nagiging perpektong tirahan para sa mga moss, ferns, lichen, at orkidyas. Ang basang tropikal na kagubatan na ito ay tahanan din ng iba\'t ibang uri ng mga hayop tulad ng paru-paro, mga daga, mga palaka, mga ibon, at mga mammal na naririto lamang sa malamig na klima."),
        "mountPulai":
            MessageLookupByLibrary.simpleMessage("Bundok Pulai, Johor"),
        "mountPulaiContent": MessageLookupByLibrary.simpleMessage(
            "Ang Bundok Pulai ay may taas na 654 metro sa Johor, Peninsular Malaysia. Dahil sa kalapitan nito at madaling pasukin, ito ay isang sikat na destinasyon ng akyatan para sa mga taga-Singapore at lokal. Ang tuktok ng Bundok Pulai ay hindi bukas sa publiko dahil ito ay protektado ng militar at may dalawang komunikasyon na tore. Ang Bundok Pulai ay mayroong 14.3 kilometrong loop trail malapit sa Kulai, Johor, Malaysia, na may isang talon at antas ng kahirapan. Ang trail na ito ay ginagamit din para sa camping, pagbibisikleta, pagtakbo, at paglalakad sa kalikasan."),
        "mrtDescription": MessageLookupByLibrary.simpleMessage(
            "Ang Mass Rapid Transit (MRT) ay nahahati sa dalawang linya; ang una ay ang linya ng Sungai Buloh-Kajang na may habang 51km na may 31 istasyon sa ruta nito. Ang lahat ng istasyon ay nagsisimula ng operasyon mula 6.00 am araw-araw. Ang oras ng pagsasara ay nag-iiba depende sa mga istasyon. Ang isang biyahe ay nagkakahalaga mula RM1.20 pataas. Helpline: 1800-82-6868"),
