        "nasiLemakDescription": MessageLookupByLibrary.simpleMessage(
            "Ang Nasi Lemak ay pabangong kanin na karaniwang niluluto sa gata ng niyog at dahon ng pandan na inihahain kasama ng maanghang na sambal, pipino, pritong dilis, itlog, at pritong mani. Ito ay pinakamahusay na ipares sa isang baso ng mainit na teh tarik. Karamihan sa mga tindahan o puwesto ay may iba pang mga pagpipilian ng add-ons tulad ng chicken o beef rendang, pritong manok, prawn sambal, at marami pang iba."),
