        "nationalMuseumDescription": MessageLookupByLibrary.simpleMessage(
            "Upang mas maunawaan ang kasaysayan at kultura ng Malaysia at makita ang mga replika ng mga bahay Malay, mga eksena ng kasal, at mga display ng pangangaso. Makikita rin ang mga lokal na instrumento at pambansang kasuotan. Bukod sa mga permanenteng exhibit sa museo, may mga pansamantalang exhibit din na nagpapalit-palit sa buong taon at nakalagay sa Central Hall."),
