        "ourCompanyDescription": MessageLookupByLibrary.simpleMessage(
            "Ang KL Ang Gabay ay isang gabay na inilalathala kada tatlong buwan, unang inilathala noong Agosto 2007. Isa kaming libreng gabay sa paglalakbay na tumutulong sa mga manlalakbay na planuhin ang kanilang paglalakbay sa paligid ng kabiserang lungsod ng Malaysia, Kuala Lumpur. Kasama sa KL Ang Gabay ang mga tip sa paglalakbay, mga lugar na dapat tuklasin, mga lugar para sa mga bata, mga hotel, at marami pang iba. Sa KL Ang Gabay, nagiging mas madali ang paglibot sa lungsod."),
