        "pangkorIsland":
            MessageLookupByLibrary.simpleMessage("Isla ng Pangkor"),
        "pangkorIslandContent": MessageLookupByLibrary.simpleMessage(
            "Tingnan ang Isla ng Pangkor kung naghahanap ka ng lugar na walang turista. Matatagpuan malapit sa baybayin ng Perak, ang isla ay may mga bakanteng dalampasigan, malinis na tubig, at isang makapal na kagubatan sa gitna. Pinahahalagahan ng mga bisita ang pagkakataong magbabad sa araw sa ilalim ng mga puno ng niyog na walang ibang tao sa paligid. Bisitahin din ang kolonyal na Dutch fort at kumuha ng litrato sa isang tradisyonal na kahoy na pantalan."),
        "panoramaHill": MessageLookupByLibrary.simpleMessage(
            "Burol ng Panorama, Sungai Lembing"),
        "panoramaHillContent": MessageLookupByLibrary.simpleMessage(
            "Ang Burol ng Panorama ay isang burol sa Sungai Lembing, 45 kilometro sa hilaga-kanluran ng Kuantan. May taas na 271 metro, mayroon lamang isang daanan paakyat. Simulan sa paanan ng hagdan at akyatin ito. Ang pangunahing katangian ng trail ay isang hagdan na may mga railing; ilang maikling bahagi lamang ang walang hagdan. Kapag narating mo na ang tuktok ng burol, makakakita ka ng tanawin ng buong siyudad. Karaniwang tumatagal ang pag-akyat sa Burol ng Panorama ng 30 hanggang 45 minuto."),
        "parks": MessageLookupByLibrary.simpleMessage("Kapihan"),
        "penangNationalPark": MessageLookupByLibrary.simpleMessage(
            "Pambansang Liwasan ng Penang, Penang"),
        "penangNationalParkContent": MessageLookupByLibrary.simpleMessage(
            "Ito ang pinakamaliit na pambansang liwasan ng Malaysia, na may sukat na 23 kilometro kuwadrado, ngunit ang mga kagubatang pinalilibutan ng dalampasigan ay tahanan ng mga unggoy na may pilak na dahon, lumilipad na lemur, pusa-leopardo, at maraming uri ng butiki, amphibian, at reptilya. Ang mga aktibidad tulad ng paglalakad sa gubat at pagsakay sa bangka papunta sa mga tahimik na dalampasigang may gintong buhangin ay tiyak na makakabuo ng isang buong araw. Mayroong dalawang pangunahing trail sa liwasan: ang isa ay papunta sa dalampasigan ng Monkey Beach, at ang isa naman ay tumatawid sa mga burol at gubat papunta sa mas liblib na mga dalampasigan kung saan matatagpuan ang Turtle Sanctuary."),
