        "pulauLangkawiContent": MessageLookupByLibrary.simpleMessage(
            "Ang isla ng Langkawi ay tahanan ng ilan sa mga pinakamahusay na dalampasigan sa Peninsular Malaysia. Pinagsasama ng isla ang mga bundok at bakawan sa kumikinang na baybayin. Maglakbay sa Pulau Dayang Bunting na nakalista sa UNESCO, pakainin ang mga agila at panoorin ang mga unggoy na lumalangoy para sa pagkain. O magdala ng iyong tuwalya at magbabad sa araw sa Pantai Cenang bago uminom sa bar na malapit sa dalampasigan. Isa pang benepisyo ay ang isla ay tax-free, kaya huwag mag-atubiling mag-shopping!"),
        "pulauRedang":
            MessageLookupByLibrary.simpleMessage("Isla ng Pulau Redang"),
        "pulauRedangContent": MessageLookupByLibrary.simpleMessage(
            "Isa sa pinakamalaking mga isla sa silangang baybayin ng Malaysia, kilala ang Pulau Redang sa kristal na malinaw na tubig at mapuputing buhangin na dalampasigan. Isa ito sa siyam na isla na bumubuo ng marine sanctuary park na nagbibigay ng pagkakataon sa mga turista na mag-snorkel at mag-dive. Ang dalampasigan ay puno ng malambot na puting buhangin. Makikita mo ang mga korales at isda sa ilang metro lamang mula sa dalampasigan."),
        "rapidKLBusDescription": MessageLookupByLibrary.simpleMessage(
            "Ang RapidKL Bus ay karaniwang makikita sa karamihan ng mga istasyon ng tren at kadalasang nagsisilbing transit-based na transportasyon para sa mga pasahero upang makarating nang diretso sa kanilang napiling destinasyon. Bawat biyahe sa bus ay maaaring magkahalaga ng hanggang RM5.00 bawat biyahe na maaaring bayaran gamit ang eksaktong barya o sa pamamagitan ng pag-tap ng iyong Touch n Go card sa pagpasok at paglabas. Helpline: 03-7885 2585"),
