        "sevenWellsContent": MessageLookupByLibrary.simpleMessage(
            "Ang Talon ng Pitong Balon, kilala rin bilang Jalan Telaga Tujuh, ay nasa humigit-kumulang 20 minuto mula sa sikat na Langkawi Sky Bridge at isa sa pinakakagandang natural na atraksyon sa isla. Ang talon ay bumabagsak mula sa bundok Mat Cincang, ang pangalawang pinakamataas na bundok sa Langkawi, at sikat sa mga turista at lokal. Ang kabuuang taas ng talon ay 91 metro, ngunit makikita lamang ang isang bahagi mula sa ibaba. Ayon sa alamat, may mga diwata sa talon at may kakayahang magbigay ng ginhawa ang tubig nito. Ang talon ay mukhang mahiwaga dahil napapalibutan ito ng kalikasan, na may masaganang flora at fauna."),
