        "sungaiLembingContent": MessageLookupByLibrary.simpleMessage(
            "Ang Malaysia ay pinagpala ng maraming kagubatan na may mga kamangha-manghang talon. Ang Rainbow Falls ay matatagpuan 45 kilometro hilagang-kanluran ng Kuantan, sa Peninsular Malaysia, sa bayan ng Sungai Lembing. Tuwing umaga sa pagitan ng 9 at 10 a.m., ang araw ay nakikita sa bumabagsak na tubig sa base ng talon, lumilikha ng isang kahanga-hangang bahaghari. Mga tao mula sa iba\'t ibang lugar ang naglalakbay ng isa at kalahating oras upang maranasan ang ganda ng kalikasan. Ang Rainbow Falls ay isang malaking talon na nakatago sa kagubatan ng Sungai Lembing, na naaabot sa pamamagitan ng biyahe ng 4WD na sasakyan at pag-hike."),
