            "Ang Pisang Falls ay isang 3.1-kilometrong landas na pabalik-balik na may talon malapit sa Gombak, Selangor, Malaysia. Ito ay angkop para sa lahat ng antas ng mga hiker. Bukas ang landas buong taon at madalas na ginagamit para sa camping, pagbibisikleta, at pagtingin sa mga ibon. Malapit sa tuktok ng talon, may mga lugar para sa piknik at camping. Isang libangan na pag-hike na nangangailangan ng pagtawid sa talon, kaya maghanda para sa basang sapatos."),
